`;

let Label = styled.label`

`;

const Checkbox = props => {
    return (
        <Label>
            {props.label}
            <StyledCheckbox type="checkbox" {...props}>{props.children}</StyledCheckbox>
        </Label>
    );
}

export default Checkbox;
